import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import './App.css';
import Home from '../src/pages/home'
import About from '../src/pages/about'
import Contact from '../src/pages/contactUs'


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home/>}/>

        </Routes>
      </Router>
    <Home/> 
    <About/>
    <Contact/>
    </div>
  );
}

export default App;
